import { DEFAULT, TIER } from '@/contants';

export const getBronzeImg = (): string =>
  `data:image/png;base64,`;

export const getSilverImg = (): string =>
  `data:image/png;base64,`;

export const getIronImg = (): string =>
  `data:image/png;base64,`;

export const getGoldImg = (): string =>
  `data:image/png;base64,`;

export const getPlatinumImg = (): string =>
  `data:image/png;base64,`;

export const getDiamondImg = (): string =>
  `data:image/png;base64,`;

export const getMasterImg = (): string =>
  `data:image/png;base64,`;

export const getGrandmasterImg = (): string =>
  `data:image/png;base64,`;

export const getChallengerImg = (): string =>
  `data:image/png;base64,`;
export const getLogoImg = (): string =>
  `data:image/png;base64,`;

export const getImgMap = () => {
  const imgMap = new Map();
  imgMap.set(TIER.IRON, getIronImg);
  imgMap.set(TIER.BRONZE, getBronzeImg);
  imgMap.set(TIER.SILVER, getSilverImg);
  imgMap.set(TIER.GOLD, getGoldImg);
  imgMap.set(TIER.PLATINUM, getPlatinumImg);
  imgMap.set(TIER.DIAMOND, getDiamondImg);
  imgMap.set(TIER.MASTER, getMasterImg);
  imgMap.set(TIER.GRANDMASTER, getGrandmasterImg);
  imgMap.set(TIER.CHALLENGER, getChallengerImg);
  imgMap.set(DEFAULT, getLogoImg);

  return imgMap;
};
